measurements.description:
Twenty-three flowers and 14 buds on five arching to pendulous inflorescences up to 70cm;
	dorsal sepal hooded, lanceolate, light yellow spotted and blushed burgundy;
	lateral sepals lanceolate, light yellow, densely spotted burgundy;
	petals lanceolate, light yellow spotted burgundy, coalescing to blotches centrally;
	lip light yellow, blotched burgundy;	

	column pale yellow blushed burgundy distally, anther cap cream;


    substance average; texture matte.
